const baseUrl = 'http://localhost:3000'

/**
 *
 * @example
 *
 * const urls = Array.from(document.querySelectorAll("a[class*=inStockCard__Link]")).map(el =>{
    return (el.getAttribute('href'))
})
 */
async function scrape() {
  for (const url of urls) {
    try {
      const response = await axios.request({
        method: 'post',
        url: `${baseUrl}/queues/run`,
        headers: {
          'Content-Type': 'application/json',
        },
        data: JSON.stringify({
          url,
          customValues: {
            // 'sws-http-client': 'browser',
            // dateTimeReference: '2024-12-31',
            // timeReference: '13',
            // 'sws-repeat': 'RRULE:FREQ=HOURLY;WKST=SU;BYDAY=MO,TU,WE,TH,FR,SA,SU;BYMINUTE=20',
          },
        }),
      })
      console.log(`Status: ${response.status}`)
    } catch (error) {
      console.error(`Error fetching ${url}:`, error.message)
    }
  }
}

async function discover() {
  for (const url of urls) {
    try {
      const response = await axios.request({
        method: 'get',
        url: `${baseUrl}/discovery?uri=${url}`,
        headers: {
          'Content-Type': 'application/json',
        },
      })
      console.log(`Status: ${response.status}`)
    } catch (error) {
      console.error(`Error fetching ${url}:`, error.message)
    }
  }
}
scrape()
